import React from "react";

export default function Resources() {
    return (
        <div className="paper">
            <h4 className="margin-top-small margin-bottom-small">More resources</h4>
            <ul>
                <li>
                    <a
                        target="_blank"
                        rel="noopener noreferrer"
                        href="https://developer.mozilla.org/en-US/docs/Web/API/Fullscreen_API"
                    >
                        Check out MDN for more details
                    </a>
                </li>
            </ul>
        </div>
    );
}
